import React, {BrowserRouter as Router, Route, Switch} from 'react';
import { ShoppingCartPanel } from './Cart/ShoppingCartPanel.tsx';
import { CheckoutForm } from './Checkout/CheckoutForm.tsx';
import './App.scss';

export const App = () => {
  return (
    <Router>
    <div>
      <h1 className="my-4 text-center">Happy Coding!</h1>
      <Switch>
          <Route exact path="/">
            <h1 className="my-4 text-center">Happy Coding!</h1>
          </Route>
          <Route path="/cart">
            <ShoppingCartPanel /> 
          </Route>
          <Route path="/checkout">
            <CheckoutForm />
          </Route>
      </Switch>
    </div>
    </Router>
  );
}
